        public string urlBase = "http://localhost:58950/api/";

        [TestMethod]
        public void IntSelecionarObra() 
        {
            // organização
            dynamic param = new System.Dynamic.ExpandoObject();
            param.descricao = "";
            param.idColaborador = 16;
            param.idContratante = 0;
            param.idContratada = 0;
            param.dataInicio = "";
            param.dataPrevisaoFim = "";
            param.dataFim = "";
            param.statusObra = 0;
            param.idMunicipio = 0;
            param.idUf = 0;
            param.setor = 0;

            var client = new RestClient(urlBase);
            var request = new RestRequest("Obra/ObterObras", Method.POST);
            request.AddJsonBody(param);

            IRestResponse response = client.Execute(request);
            var content = response.Content;

            Assert.IsTrue(response.IsSuccessful);
        }

